 value=\&quot;&amp;lt;span style=&amp;quot;orphans: 2; text-indent: 0px; widows: 2; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; float: none; display: inline !important;&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;&amp;quot; color=&amp;quot;#000000&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;white-space: pre;&amp;quot;&amp;gt;&amp;#x9;&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;white-space: pre;&amp;quot;&amp;gt;&amp;#x9;&amp;lt;/span&amp;gt;quantum computation.This complexity is compounded in the case of near-term quantum computing where parameterised circuits are prevalent and&amp;amp;nbsp;&amp;lt;/font&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;font color=&amp;quot;#000000&amp;quot;&amp;gt;selecting the optimal circuit structure ansatz is crucial to ensure trainability.&amp;lt;/font&amp;gt;\&quot; style=\&quot;shape=rectangle;html=1;whiteSpace=wrap;rounded=1;overflow=hidden;strokeWidth=1;fontSize=32;align=left;glass=0;fillColor=none;strokeColor=none;\&quot; parent=\&quot;aC8qcCINiwaLVtJp1X52-212\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;112\&quot; y=\&quot;590\&quot; width=\&quot;1035\&quot; height=\&quot;162\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;aC8qcCINiwaLVtJp1X52-297\&quot; value=\&quot;&amp;lt;p class=&amp;quot;MsoNormal&amp;quot;&amp;gt;&amp;lt;font color=&amp;quot;#222222&amp;quot;&amp;gt;Many quantum algorithms exhibit recurring patterns in their circuit designs, for example the repeating cascade of controlled rotations seen in the quantum Fourier transformation. These patterns lend themselves well to modularisation.&amp;amp;nbsp;&amp;lt;/font&amp;gt;&amp;lt;/p&amp;gt;&amp;lt;p class=&amp;quot;MsoNormal&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;background-color: initial;&amp;quot; color=&amp;quot;#222222&amp;quot;&amp;gt;Building on work by Lourens, et. al.&amp;lt;span style=&amp;quot;font-size: 26.6667px;&amp;quot;&amp;gt;&amp;amp;nbsp;[1]&amp;lt;/span&amp;gt;, we propose a circuit synthesis strategy based on a genetic algorithm which exploits the modularity and hierarchical structure of quantum circuits to efficiently discover novel implementations of quantum algorithms, while also taking&amp;amp;nbsp;&amp;lt;/font&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial; color: rgb(34, 34, 34);&amp;quot;&amp;gt;&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\&quot; style=\&quot;shape=rectangle;html=1;whiteSpace=wrap;rounded=1;overflow=hidden;strokeWidth=1;fontSize=32;align=left;glass=0;fillColor=none;strokeColor=none;\&quot; parent=\&quot;aC8qcCINiwaLVtJp1X52-212\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;1221\&quot; y=\&quot;346\&quot; width=\&quot;1036\&quot; height=\&quot;404\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;aC8qcCINiwaLVtJp1X52-300\&quot; value=\&quot;&amp;lt;font color=&amp;quot;#222222&amp;quot; style=&amp;quot;border-color: rgb(0, 0, 0); font-family: Helvetica; font-size: 32px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: initial; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;&amp;quot;&amp;gt;into&amp;amp;nbsp;&amp;lt;/font&amp;gt;&amp;lt;span style=&amp;quot;border-color: rgb(0, 0, 0); font-family: Helvetica; font-size: 32px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: initial; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; color: rgb(34, 34, 34);&amp;quot;&amp;gt;account the set of available gates for a given hardware.&amp;lt;/span&amp;gt;\&quot; style=\&quot;text;whiteSpace=wrap;html=1;fontSize=20;fontFamily=Architects Daughter;\&quot; parent=\&quot;aC8qcCINiwaLVtJp1X52-212\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;1225\&quot; y=\&quot;710\&quot; width=\&quot;897\&quot; height=\&quot;99\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;aC8qcCINiwaLVtJp1X52-301\&quot; value=\&quot;&amp;lt;p class=&amp;quot;MsoNormal&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;color: rgb(34, 34, 34);&amp;quot;&amp;gt;[1] Lourens, Matt, et al. &amp;quot;Hierarchical quantum circuit representations for neural architecture search.&amp;quot;&amp;amp;nbsp;npj Quantum Information&amp;amp;nbsp;9.1 (2023): 79.&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\&quot; style=\&quot;shape=rectangle;html=1;whiteSpace=wrap;rounded=1;overflow=hidden;strokeWidth=1;fontSize=32;align=left;glass=0;fillColor=none;strokeColor=none;fontFamily=Helvetica;\&quot; parent=\&quot;aC8qcCINiwaLVtJp1X52-212\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;1230\&quot; y=\&quot;3069\&quot; width=\&quot;854\&quot; height=\&quot;157\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;j0urlR9IVVpPPl2k4iku-28\&quot; value=\&quot;&amp;lt;font color=&amp;quot;#000000&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;font-size: 30px;&amp;quot;&amp;gt;&amp;lt;b&amp;gt;Mutation:&amp;amp;nbsp;&amp;lt;/b&amp;gt;Discrete changes to a randomly chosen hyperparameter.&amp;lt;br&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/font&amp;gt;\&quot; style=\&quot;shape=rectangle;html=1;whiteSpace=wrap;rounded=1;overflow=hidden;strokeWidth=1;fontSize=32;align=justify;glass=0;fillColor=none;strokeColor=none;\&quot; parent=\&quot;aC8qcCINiwaLVtJp1X52-212\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;1037\&quot; y=\&quot;1141\&quot; width=\&quot;582\&quot; height=\&quot;78\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;j0urlR9IVVpPPl2k4iku-29\&quot; value=\&quot;&amp;lt;font color=&amp;quot;#000000&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;font-size: 30px;&amp;quot;&amp;gt;&amp;lt;b&amp;gt;Crossover: &amp;lt;/b&amp;gt;New motifs can be generated by&amp;amp;nbsp;joining, interleaving or splicing motifs from the population.&amp;lt;br&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/font&amp;gt;\&quot; style=\&quot;shape=rectangle;html=1;whiteSpace=wrap;rounded=1;overflow=hidden;strokeWidth=1;fontSize=32;align=justify;glass=0;fillColor=none;strokeColor=none;\&quot; parent=\&quot;aC8qcCINiwaLVtJp1X52-212\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;1035\&quot; y=\&quot;1429\&quot; width=\&quot;585\&quot; height=\&quot;126\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;j0urlR9IVVpPPl2k4iku-32\&quot; value=\&quot;&amp;lt;font color=&amp;quot;#000000&amp;quot;&amp;gt;&amp;lt;b style=&amp;quot;font-size: 30px;&amp;quot;&amp;gt;Population: &amp;lt;/b&amp;gt;Circuits are generated using&amp;amp;nbsp;HierarQcal&amp;#39;s &amp;lt;i&amp;gt;motifs&amp;lt;/i&amp;gt;. A &amp;lt;i&amp;gt;motif&amp;lt;/i&amp;gt; is a model that describes the sequentual placement of an &amp;lt;i&amp;gt;n&amp;lt;/i&amp;gt;-qubit operation onto the cicuit.&amp;lt;br&amp;gt;&amp;lt;/font&amp;gt;\&quot; style=\&quot;shape=rectangle;html=1;whiteSpace=wrap;rounded=1;overflow=hidden;strokeWidth=1;fontSize=32;align=right;glass=0;fillColor=none;strokeColor=none;\&quot; parent=\&quot;aC8qcCINiwaLVtJp1X52-212\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;254\&quot; y=\&quot;1143\&quot; width=\&quot;661\&quot; height=\&quot;158\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;j0urlR9IVVpPPl2k4iku-42\&quot; value=\&quot;&amp;lt;font color=&amp;quot;#000000& ot;78\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;j0urlR9IVVpPPl2k4iku-36\&quot; value=\&quot;&amp;lt;div style=&amp;quot;font-size: 25px;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;font-size: 25px; color: rgb(0, 0, 0); background-color: initial;&amp;quot;&amp;gt;Available&amp;lt;/span&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;font color=&amp;quot;#000000&amp;quot; style=&amp;quot;font-size: 25px;&amp;quot;&amp;gt;&amp;lt;div style=&amp;quot;font-size: 25px;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;font-size: 25px; background-color: initial;&amp;quot;&amp;gt;operations&amp;lt;/span&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;/font&amp;gt;\&quot; style=\&quot;shape=rectangle;html=1;whiteSpace=wrap;rounded=1;overflow=hidden;strokeWidth=1;fontSize=25;align=center;glass=0;fillColor=none;strokeColor=none;\&quot; parent=\&quot;aC8qcCINiwaLVtJp1X52-212\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;220\&quot; y=\&quot;1327\&quot; width=\&quot;155\&quot; height=\&quot;78\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;j0urlR9IVVpPPl2k4iku-87\&quot; value=\&quot;&amp;lt;div style=&amp;quot;&amp;quot;&amp;gt;&amp;lt;b style=&amp;quot;font-size: 30px; color: rgb(0, 0, 0); background-color: initial;&amp;quot;&amp;gt;Finding the Toffoli gate: &amp;lt;/b&amp;gt;&amp;lt;span style=&amp;quot;font-size: 30px; color: rgb(0, 0, 0); background-color: initial;&amp;quot;&amp;gt;Given&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;font-size: 30px; color: rgb(0, 0, 0); background-color: initial;&amp;quot;&amp;gt;&amp;amp;nbsp;five&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;font-size: 30px; color: rgb(0, 0, 0); background-color: initial;&amp;quot;&amp;gt;&amp;amp;nbsp;mappings (three 1-qubit and two 2-qubit) there are 27&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;color: rgb(0, 0, 0); background-color: initial; font-size: 25px;&amp;quot;&amp;gt;&amp;lt;sup&amp;gt;7&amp;amp;nbsp;&amp;lt;/sup&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;color: rgb(0, 0, 0); background-color: initial;&amp;quot;&amp;gt;(10&amp;lt;sup&amp;gt;10&amp;lt;/sup&amp;gt;) possible circuits of length 7. Using our approach, the exact circuit was found with &amp;amp;gt;90% probability after&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial; color: rgb(0, 0, 0); font-size: 30px;&amp;quot;&amp;gt;&amp;amp;nbsp;&amp;amp;lt;2&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;font-size: 30px; color: rgb(0, 0, 0); background-color: initial;&amp;quot;&amp;gt;00 generations of 100 new individuals (10&amp;lt;sup&amp;gt;4&amp;lt;/sup&amp;gt;)&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;color: rgb(0, 0, 0); background-color: initial;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;font-size: 30px;&amp;quot;&amp;gt;. All other non-trivial 3-qubit reversible logical operations were also found in this way.&amp;lt;/span&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/div&amp;gt;\&quot; style=\&quot;shape=rectangle;html=1;whiteSpace=wrap;rounded=1;overflow=hidden;strokeWidth=1;fontSize=32;align=center;glass=0;fillColor=none;strokeColor=none;fontStyle=0\&quot; parent=\&quot;aC8qcCINiwaLVtJp1X52-212\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;1244\&quot; y=\&quot;1992\&quot; width=\&quot;819\&quot; height=\&quot;277\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;j0urlR9IVVpPPl2k4iku-91\&quot; value=\&quot;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;&amp;lt;font color=&amp;quot;#000000&amp;quot;&amp;gt;I&amp;lt;/font&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial; color: rgb(0, 0, 0);&amp;quot;&amp;gt;n the context of quantum machine learning, we have noted that circuits generated are often&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;b style=&amp;quot;background-color: initial; color: rgb(0, 0, 0);&amp;quot;&amp;gt;interpretable&amp;lt;/b&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial; color: rgb(0, 0, 0);&amp;quot;&amp;gt;.&amp;lt;/span&amp;gt;&amp;lt;br&amp;gt;&amp;lt;div style=&amp;quot;font-size: 30px;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;font-size: 30px; color: rgb(0, 0, 0); background-color: initial;&amp;quot;&amp;gt;&amp;lt;br style=&amp;quot;font-size: 30px;&amp;quot;&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div style=&amp;quot;font-size: 30px;&amp;quot;&amp;gt;&amp;lt;font color=&amp;quot;#000000&amp;quot; style=&amp;quot;font-size: 30px;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;font-size: 30px;&amp;quot;&amp;gt;We plan to test an&amp;amp;nbsp;&amp;lt;b style=&amp;quot;font-size: 30px;&amp;quot;&amp;gt;annealing&amp;lt;/b&amp;gt;&amp;amp;nbsp;approach, since each circuit has a clearly defined neighbourhood in parameter space.&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div style=&amp;quot;font-size: 30px;&amp;quot;&amp;gt;&amp;lt;font color=&amp;quot;#000000&amp;quot; style=&amp;quot;font-size: 30px;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;font-size: 30px;&amp;quot;&amp;gt;&amp;lt;br style=&amp;quot;font-size: 30px;&amp;quot;&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div style=&amp;quot;font-size: 30px;&amp;quot;&amp;gt;&amp;lt;font color=&amp;quot;#000000&amp;quot; style=&amp;quot;font-size: 30px;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;font-size: 30px;&amp;quot;&amp;gt;This framework is based on &amp;lt;b style=&amp;quot;font-size: 30px;&amp;quot;&amp;gt;tensor networks&amp;lt;/b&amp;gt; and can therefore be used for arbitrary tensor network generation, e.g. for classical computation or higher dimensional quantum systems (qudits).&amp;lt;/span&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;/div&amp;gt;\&quot; style=\&quot;shape=rectangle;html=1;whiteSpace=wrap;rounded=1;overflow=hidden;strokeWidth=1;fontSize=30;align=center;glass=0;fillColor=none;strokeColor=none;fontStyle=0\&quot; parent=\&quot;aC8qcCINiwaLVtJp1X52-212\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;83\&quot; y=\&quot;2902\&quot; width=\&quot;1048\&quot; height=\&quot;327\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;j0urlR9IVVpPPl2k4iku-92\&quot; value=\&quot;&amp;lt;font color=&amp;quot;#000000&amp;quot; style=&amp;quot;font-size: 30px;&amp;quot;&amp;gt;Our workflow is &amp;lt;b style=&amp;quot;font-size: 30px;&amp;quot;&amp;gt;independent of the number of qubits&amp;lt;/b&amp;gt; and a mofit can be evaluated on a sample of circuit sizes, e.g. for variational quantum eigensolvers.&amp;lt;/font&amp;gt;\&quot; style=\&quot;shape=rectangle;html=1;whiteSpace=wrap;rounded=1;overflow=hidden;strokeWidth=1;fontSize=30;align=center;glass=0;fillColor=none;strokeColor=none;fontStyle=0\&quot; parent=\&quot;aC8qcCINiwaLVtJp1X52-212\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;306\&quot; y=\&quot;2760\&quot; width=\&quot;805\&quot; height=\&quot;132\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;j0urlR9IVVpPPl2k4iku-93\&quot; value=\&quot;&amp;lt;font color=&amp;quot;#000000&amp;quot; style=&amp;quot;font-size: 32px;&amp;quot;&amp;gt;AR would like to acknowledge the National Reasearch foundation for funding recieved. ML would like to acknowledge the Unitary Fund and the Oppenheimer Memorial Trust for funding recieved.&amp;lt;/font&amp;gt;\&quot; style=\&quot;shape=rectangle;html=1;whiteSpace=wrap;rounded=1;overflow=hidden;strokeWidth=1;fontSize=32;align=justify;glass=0;fillColor=none;strokeColor=none;fontStyle=0\&quot; parent=\&quot;aC8qcCINiwaLVtJp1X52-212\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;1447\&quot; y=\&quot;2620\&quot; width=\&quot;806\&quot; height=\&quot;168\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;j0urlR9IVVpPPl2k4iku-95\&quot;
